import numpy as np
import matplotlib.pyplot as plt

# run this cell before proceeding further
x = np.arange(0,100)
y = x*2
z = x**2

"""**Use the above given x and y to solve the question  from 1,2 and 3.**

1)Create a figure object called fig using plt.figure(). Add an axis to the figure canvas at [0,0,1,1]. Call this new axis 'ax'. Plot (x,y) on that axes and set the labels and titles to match the plot below:

![matplotlib1.png](data:image/png;base64,)
"""

#your code here
fig=plt.figure()
ax=fig.add_axes([0,0,1,1])
ax.plot(x,y)
plt.xlabel("x")
plt.ylabel("y",rotation=90)
plt.title("title")
plt.show()

