"""4)Use the dictionary 'n_users' to plot a pie chart as shown below.

![image.png](data:image/png;base64,)
"""

# run this cell before proceeding further
n_users = {'Windows':323,'Android':403,'iOS':165,'OS X':71,'Linux':9}

#your code here
users=list(n_users.values())
labels=list(n_users.keys())
plt.pie(users,labels=labels,autopct="%1.2f%%",colors=["dodgerblue","chartreuse","dimgray","silver","orange"])
plt.show()

"""5)The array 'over' contains the number of over and the array 'runs' contains the runs scored in each respective over.
Plot the total score for each over similar to the one shown below.

![Plot.png](data:image/png;base64,)
"""

# run this cell before proceeding further
over = np.arange(1,21)
over

# run this cell before proceeding further
runs = np.random.randint(1,200,20)
runs

#your code here
plt.plot(over,runs,'orange',linewidth=4,marker='o',markeredgecolor='b',markersize=7,markerfacecolor='b')
